# ecom/manage.pyimport osimport sysdef main():    os.environ.setdefault('DJANGO_SETTINGS_MODULE', 'sanruum.settings')    try:        from django.core.management import execute_from_command_line        from django.core.management.commands.runserver import Command as RunserverCommand        if 'runsslserver' in sys.argv:            from apps.support.managment.commands.runsslserver import Command as SSLServerCommand            RunserverCommand = SSLServerCommand        execute_from_command_line(sys.argv)    except ImportError as exc:        raise ImportError(            "Couldn't import Django. Are you sure it's installed and "            "available on your PYTHONPATH environment variable? Did you "            "forget to activate a virtual environment?"        ) from excif __name__ == "__main__":    main()